{% extends "bigData/index.html" %}
{% load staticfiles %}
{% block content %}
<link rel="stylesheet" href="{% static '/css/menu1.css' %}">
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/tempusdominus-bootstrap-4/5.0.0-alpha14/css/tempusdominus-bootstrap-4.min.css" />
{% if messages %}
<script>
alert('{{messages}}');
</script>
{% endif%}


<div class="col-sm-12">
  <div class="alert  alert-success alert-dismissible fade show" role="alert">
    <span class="badge badge-pill badge-success">Success</span> 구역별 방문자 수
    <button type="button" class="close" data-dismiss="alert" aria-label="Close">
            <span aria-hidden="true">&times;</span>
      </button>
  </div>
</div>
<div class="col col-lg-12">
  <div class='card'>
    <div class='card-header'>
      <strong> 버튼 </strong>
    </div>
    <div class='card-body text-secondary'>
      <div class="row">
        <div class="col col-lg-12">
          <div class='col-lg-4'>
            <strong>성별 : </strong>
            <span id="radioValue">전체 선택</span>
            <span>중</span>
            <form method="post">{% csrf_token %}
            <div class="btn-group btn-group-toggle" id = "btn_type" data-toggle="buttons">
              <label class="btn btn-secondary active">
                <input type="radio" checked name="options" value = "all" autocomplete="off">  전체
              </label>
              <label class="btn btn-primary">
                <input type="radio" name="options" value = "man" autocomplete="off"> 남성
              </label>
              <label class="btn btn-danger">
                <input type="radio" name="options" value = "women" autocomplete="off" > 여성
              </label>
            </div>
            </br>
          </div>
        </div>
      </div>
      <br>
      <div class="row">
        <div class='col-lg-12'>
          <div class='col-lg-2'>
            <strong>시간</strong>
          </div>
          <div class='col-lg-4'>
            <!--데이트 시간 알수 있음~!-->
            <!--Note All functions are accessed via the $('#datetimepicker').datetimepicker(FUNCTION)-->
            <form method="post">{% csrf_token %}
            <div class="form-group">
              <div class="input-group date" id="datetimepicker7" data-target-input="nearest">
                <input type="text" name="from_date" class="form-control datetimepicker-input" data-target="#datetimepicker7" />
                <div class="input-group-append" data-target="#datetimepicker7" data-toggle="datetimepicker" >
                  <div class="input-group-text"><i class="fa fa-calendar"></i></div>
                </div>
              </div>
            </div>
          </div>
          <div class='col-lg-4'>
            <div class="form-group">
              <div class="input-group date" id="datetimepicker8" data-target-input="nearest">
                <input type="text" name="to_date" class="form-control datetimepicker-input" data-target="#datetimepicker8" />
                <div class="input-group-append" data-target="#datetimepicker8" data-toggle="datetimepicker" >
                  <div class="input-group-text"><i class="fa fa-calendar"></i></div>
                </div>
              </div>
            </div>
          </div>
          <div class='col-lg-2'>
            <input class="btn btn-primary btn-sm" type="submit" value="조회"/>
          </div>
        </form>
        </div>
      </div>
    </div>
  </div>
</div>

  function RMS(arr) {
    return Math.pow(arr.reduce(function(acc, pres) {
      return acc + Math.pow(pres, 2);
    }) / arr.length, .5)
  }

  // mean
  function mean(arr) {
    return arr.reduce(function(acc, prev) {
      return acc + prev;
    }) / arr.length;
  }

  function bandClassifier(val, multiplier)
  {

      return (Math.floor((val * multiplier) / (.33 * multiplier)) + 1) > 3 ? 3 : Math.floor((val * multiplier) / (.33 * multiplier)) + 1
    } else {
      return (Math.floor((val * multiplier) / (.33 * multiplier))) < -3 ? -3 : Math.floor((val * multiplier) / (.33 * multiplier))

        } else {
          objStores.x = dxS[0];
          objStores.y = dyS[0] += j;
        }
        countflag++;
        objArrays.push(objStores);
      }

      var xScale = d3.scaleBand()
        .domain(x_elements)
        .range([0, x_elements.length * itemSize])
        .paddingInner(20).paddingOuter(cellSize / 2)

      var xAxis = d3.axisBottom()
        .scale(xScale)
        .tickFormat(function(d) {
          return d;
        });

      var yScale = d3.scaleBand()
        .domain(y_elements)
        .range([0, y_elements.length * itemSize])
        .paddingInner(.2).paddingOuter(.2);

      var yAxis = d3.axisLeft()
        .scale(yScale)
        .tickFormat(function(d) {
          return d;
        });


      // Finding the mean of the data
      var mean = window.mean(data.map(function(d) {
        return +d.value
      }));
      //setting percentage change for value w.r.t average
      data.forEach(function(d) {
        d.perChange = (d.value - mean) / mean
      })

      colorScale = d3.scaleOrdinal()
        .domain([-3, -2, -1, 1, 2, 3])
        .range(colorHold);

      var rootsvg = d3.select('.heatmap')
        .append("svg")
        .attr("width", width + margin.left + margin.right)
        .attr("height", height + margin.top + margin.bottom)

      var svg = rootsvg.append("g")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

      // tooltip
      tooltip = d3.select("body").append("div").style("width", "180px").style("height", "100px").style("background", "#C3B3E5")
        .style("opacity", "1").style("position", "absolute").style("visibility", "hidden").style("box-shadow", "0px 0px 6px #7861A5").style("padding", "10px");
      toolval = tooltip.append("div");

      var map = d3.select('#animated')
        .attr("width", "500px")
        .attr("height", "700px")

      var pointer = map
        .append("use")
        .attr("href", "#pointer")
        .attr("transform", "translate(" + 0 + "," + 0 + ") scale(0)")
        .attr("fill", "#039BE5")
        .attr("stroke", "#455A64")
        .attr("stroke-width", "3px");

      tooltip2 = d3.select(".svg-container").append("div").style("width", "160px").style("height", "140px").style("background", "#039be5").style("color", "white")
        .style("opacity", "1").style("position", "absolute").style("visibility", "hidden").style("box-shadow", "0px 0px 6px #7861A5").style("padding", "10px");
      toolval2 = tooltip2.append("div");

      var cells = svg.selectAll('rect')
        .data(data)
        .enter().append('g').append('rect')
        .attr('class', 'cell')
        .attr('width', cellSize)
        .attr('height', cellSize)
        .attr('y', function(d) {
          return yScale(d.country);
        })
        .attr('x', function(d) {
          return xScale(d.product) - cellSize / 2;
        })
        .attr('fill', function(d) {
          return colorScale(window.bandClassifier(d.perChange, 100));
        })
        .attr("rx", 2)
        .attr("ry", 2)
        .on("mouseover", function(d) {

          console.log(d);
          for (ket in objArrays) {
            //alert(objArrays[ket].name + '' +objArrays[key].x);
            if (d.product == objArrays[ket].name) {
              pointer
                .transition()
                .duration(500)
                .attr("transform", "scale(1)")
                .attr("x", objArrays[ket].x)
                .attr("y", objArrays[ket].y);
              tooltip2.style("visibility", "visible")
                .style("top", (100) + "px").style("left", (1350) + "px");
              tooltip2.select("div").html("<strong>" + "구역 : " + d.product + "</strong><br/> " + "방문자 수 : " + (+d.value).toFixed(0))
            }
          }
          //alert(d.product);
          //d3.select(this).attr("fill","#655091");
          d3.select(this).style("stroke", "orange").style("stroke-width", "7px")
          d3.select(".trianglepointer").transition().delay(100).attr("transform", "translate(" + (-((lPatchWidth / colorScale.range().length) / 2 + (colorScale.domain().indexOf(bandClassifier(d.perChange, 100)) * (lPatchWidth / colorScale.range()
            .length)))) + ",0)");
        })
        .on("mouseout", function() {
          //d3.select(this).attr('fill', function(d) { return colorScale(window.bandClassifier(d.perChange,100));});
          d3.select(this).style("stroke", "none");
          tooltip.style("visibility", "hidden");
          tooltip2.style("visibility", "hidden");

          pointer.transition()
            .attr("transform", "translate(" + pointer.attr("x") + "," + pointer.attr("y") + ") scale(0)")
        })

        .on("mousemove", function(d) {
          tooltip.style("visibility", "visible")
            .style("top", (d3.event.pageY - 30) + "px").style("left", (d3.event.pageX + 20) + "px");
          console.log(d3.mouse(this)[0])
          tooltip.select("div").html("<strong>" + "구역 : " + d.product + "</strong><br/> " + "방문자 수 : " + (+d.value).toFixed(0))
        })

      svg.append("g")
        .attr("class", "y axis")
        .call(yAxis)
        .selectAll('text')
        .attr('font-size', '15px')
        .attr('font-weight', 'normal');

      svg.append("g")
        .attr("class", "x axis")
        .attr("transform", "translate(0," + (y_elements.length * itemSize + cellSize / 2) + ")")
        .call(xAxis)
        .selectAll('text')
        .attr('font-size', '15px')
        .attr('font-weight', 'normal')
        .style("text-anchor", "end")
        .attr("dx", "-.8em")
        .attr("dy", "-.5em")
        .attr("transform", function(d) {
          return "rotate(-65)";
        });

      // Legends section


      legends = svg.append("g").attr("class", "legends")
        .attr("transform", "translate(" + ((width + margin.right) / 2 - lPatchWidth / 2 - margin.left / 2) + "," + (height + margin.bottom - 35 - 20) + ")");

      // Legend traingle pointer generator
      var symbolGenerator = d3.symbol()
        .type(d3.symbolTriangle)
        .size(128);

      legends.append("g").attr("transform", "rotate(180)").append("g").attr("class", "trianglepointer")
        .attr("transform", "translate(" + (-lPatchWidth / colorScale.range().length) / 2 + ")")
        .append("path").attr("d", symbolGenerator());
      //Legend Rectangels
      legends.append("g").attr("class", "LegRect")
        .attr("transform", "translate(0," + 15 + ")")
        .selectAll("rect").data(colorScale.range()).enter()
        .append("rect").attr("width", lPatchWidth / colorScale.range().length + "px").attr("height", "15px").attr("fill", function(d) {
          return d
        })
        .attr("x", function(d, i) {
          return i * (lPatchWidth / colorScale.range().length)
        })

      // legend text
      legends.append("g").attr("class", "LegText")
        .attr("transform", "translate(0,45)")
        .append("text")
        .attr("x", lPatchWidth / 2)
        .attr('font-weight', 'normal')
        .style("text-anchor", "middle")
        var gender;
        if("{{selectRadio|escapejs}}" == "man")
        {
          gender = "남자";
        }
        else if("{{selectRadio|escapejs}}" == "women")
        {
          gender = "여자";
        }
        else {
          gender = "전체";
        }
      // Heading
      rootsvg.append("g")
        .attr("transform", "translate(0,30)")
        .append("text")
        .attr("x", (width + margin.right + margin.left) / 2)
        .attr('font-weight', 'bold')
        .attr('font-size', '30px')
        .attr('font-family', 'Segoe UI bold')
        .style("text-anchor", "middle")
        .text("구역별 "+ gender + "방문자 수")
        var sum = 0;
        sum += (data.map(function(d) {return d.value}))
        var suuum = 0;
        realSUm = sum.split(',');
        for(var i = 0; i<realSUm.length;i++)
        {
          suuum += parseInt(realSUm[i]);
        }

        rootsvg.append("g")
          .attr("transform", "translate(0,30)")
          .append("text")
          .attr("x", (width + margin.right + margin.left) / 2)
          .attr("y", (margin.top) / 2)
          .attr('font-weight', 'bold')
          .attr('font-size', '20px')
          .attr('font-family', 'Segoe UI bold')
          .style("text-anchor", "middle")
          .text("전체 날짜" )

          //Y Title
          rootsvg.append("g")
              .attr("transform", "translate(0,30)")
              .append("text")
              .attr("x", (margin.left) / 2)
              .attr("y", (margin.top) / 2)
              .attr('font-weight', 'bold')
              .attr('font-size', '15px')
              .attr('font-family', 'Segoe UI bold')
              .style("text-anchor", "middle")
              .text("시간대")


            //// X:  Title
            rootsvg.append("g")
                .attr("transform", "translate(0,0)")
                .append("text")
                .attr("x", 25)
                .attr("y",420)
                .attr('font-weight', 'bold')
                .attr('font-size', '15px')
                .attr('font-family', 'Segoe UI bold')
                .style("text-anchor", "middle")
                .text("구역")



    });
  }
</script>
